import DragDropFile from './DragDropFile';
import { useState } from 'react'


const Upload = () => {
    const [processedImages, setProcessedImages] = useState(null);

    if (!processedImages) {
        return (
        <div>  
            <DragDropFile setProcessedImages={setProcessedImages}/>
        </div>);
    } else {
        return (
            <div>
                    <section className='output-container'>
                     <div className='upload-container-detail'>



                     </div>
                    </section>
                <section className="scanningmethods">
                    <p>Detected photos: </p>

                    <div className="pizza"> 
                    <div className="row">
                        {processedImages.map(item => {
                                return (
                                    <div className="method-col">
                                        <h3 className='outputTitle'>Image </h3>
                                        <img src={item} alt="" />
                                        <div className="layer"> </div>
                                    </div>)
                            })}
                    </div>
                    </div>
                </section>
            </div>
        )
    }
};

export default Upload;
